export default function List(props) {    

  const {category, products} = props;

  return (
    <div>
      <h2>{category}</h2>
      <ul>{products.map(({id, name, brand, model, price}) => {
        return (<li key={id}>
                  {name} {brand} {model} {price}
                </li>)
      })}
      </ul>
    </div>
  )
}

